x不就是 能被x整除却不能被y整除的正整数 吗？！


------------

```cpp
#include<bits/stdc++.h>//万能库
using namespace std;
int main()
{ 
    int x,y;
    cin>>x>>y;
    if(x%y)cout<<x;//除不尽输x
    else cout<<-1;//否则输-1
    puts("");//统一换行
}
```


