###### ~~这题很快也要被隐藏了吧~~

求最小的数是X的倍数但不是Y的倍数；

如果Y能被X整除，则输出X，否则输出-1。

以下为pascal代码：

```pascal
var
    x,y:longint;
begin
    read(x,y);
    if x mod y<>0 then writeln(x)
        else writeln(-1);
end.
```
